    let[state, setState] = useState({
        recipes: []
    });

    useEffect(()=>{
        RecipeService.getAllRecipes().then((response)=>{
            setState(()=>{
                recipes:response.data
            });

        },()=>{});

    },[]);
    console.log(JSON.stringify(state.recipes))
    return(
        <></>
    );
}

export default ViewRecipe;
